import React from 'react';
import ReactDOM from 'react-dom';
import App from './App'
import {Provider} from "react-redux";
import {store} from "./redux/store";
import './index.scss';
import 'normalize.css';


ReactDOM.render(
  <Provider store={store}>
    <App/>
  </Provider>, document.getElementById('root'))
